import React from 'react';
import education from'../data/education.json'

const School = () => {

            return education.map((school) => {

                return(
                    <div>
                        <h1>{school.institution}</h1>
                    </div>
                );

            });


};


const Education = () => {
    return (
        <div>
            <School/>
        </div>
    );
};





export default Education;
